// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

import "./ICourseEnrollment.sol";

contract Users {
    // Define una estructura para representar un usuario
    struct User {
        string nombre;
        uint edad;
        string correo;
        string rol;
    }

    ICourseEnrollment public courseEnrollment;

    constructor(address _courseEnrollmentAddress) {
        courseEnrollment = ICourseEnrollment(_courseEnrollmentAddress);
    }

    // Mapeo para almacenar usuarios con una direccin nica (puede ser la direccin del usuario)
    mapping(address => User) private users;

    // Evento para emitir cuando se agrega un nuevo usuario
    event UserAdded(address indexed usuario, string nombre, uint edad, string correo, string rol);

    // Funcin para agregar un nuevo usuario
    function agregarUsuario(string memory _nombre, uint _edad, string memory _correo, string memory _role) public {

        // Verifica si el usuario ya existe
        if (bytes(users[msg.sender].nombre).length != 0) {
            revert("El usuario ya existe");
        }

        // Verifica si el rol es vlido
        bytes32 rolHash = keccak256(abi.encodePacked(_role));
        if (rolHash != keccak256(abi.encodePacked("Admin")) &&
            rolHash != keccak256(abi.encodePacked("Professor")) &&
            rolHash != keccak256(abi.encodePacked("Student"))) {
            revert("El rol no es valido");
        }
        if (bytes(users[msg.sender].rol).length != 0) {
            courseEnrollment.asignRoleToUser(users[msg.sender].rol);
        }

        // Agrega el usuario al mapeo usando la direccin del remitente como clave

        users[msg.sender] = User(_nombre, _edad, _correo, _role);

        // Emitir un evento para notificar que se ha agregado un nuevo usuario
        emit UserAdded(msg.sender, _nombre, _edad, _correo, _role);
    }

    // Funcin para obtener la informacin de un usuario
    function obtenerUsuario(address _usuario) public view returns (string memory nombre, uint edad, string memory correo) {
        User storage user = users[_usuario];
        return (user.nombre, user.edad, user.correo);
    }

    function removeUser() public {
        if (bytes(users[msg.sender].rol).length != 0) {
            courseEnrollment.deleteAdminOrProfessor(users[msg.sender].rol);
        }
        delete users[msg.sender];
    }
}
